export default function Footer() {
  return (
    <footer className="w-full bg-primary-50 border-t border-gray-100 py-4 px-6 flex items-center justify-between text-sm text-gray-500 mt-auto">
      <span>&copy; {new Date().getFullYear()} MediSync. All rights reserved.</span>
      <span>
        <a href="/privacy" className="hover:underline mr-4">Privacy Policy</a>
        <a href="/terms" className="hover:underline">Terms of Service</a>
      </span>
    </footer>
  );
}
